import React from 'react';
import '../App.css';
import Nav from './Nav';
import Shop from './Shop';
import About from './About';
import ItemDetail from '../ItemDetail';
import Account from '../Account/Account';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
<link href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.0-beta3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-eOJMYsd53ii+scO/bJGFsiCZc+5NDVN2yr8+0RDqr0Ql0h+rP48ckxlpbzKgwra6" crossorigin="anonymous"></link>

function App() {
  let url = "http://localhost:3000/shop"
  return (
    <Router>
    <div className="App">
      <Nav/>
      <Switch>
        <Route path="/" exact component={Home}/>
      <Route path="/about" component={About}/>
      <Route path="/shop" exact component={Shop}/>
      <Route path="/shop/:id/" component={ItemDetail}/>
      <Route path="/account" component={Account}/>
      </Switch>
    </div>
    </Router>
  );
}

const Home = ()=>(

  <section className="album-result-free">
    <div className="cointainer">
        <div className="row">
          <h2>Đang tìm kiếm nhạc?</h2>
          <p className="lead">Tiep tuc ban nhac da phat gan day tu doan ban dung</p>
          <a id="segmented-desktop-launch" className="btn btn-stroked-dark" role="button" href="."></a>
        </div>
    </div>
  </section>
);
export default App;
